mutation registerOrUpdateDevice($deviceId: UUID, $input: DeviceInput!) {
  registerOrUpdateDevice(deviceId: $deviceId, device: $input) {
    __typename
    deviceId
    sentry {
      __typename
      env
      dsn
    }
  }
}

query GetConversations($page: OpaqueCursorPage!) {
  conversations(page: $page) {
    __typename
    conversations {
      __typename
      ...ConversationFragment
    }
    nextCursor
    hasMore
  }
}
fragment ConversationFragment on Conversation {
  __typename
  id
  title
  subtitle
  lastMessagePreview
  unreadMessageCount
  inboxPreviewTitle
  updatedAt
  pictureUrl {
    __typename
    ...EphemeralUrlFragment
  }
  providers {
    __typename
    ...ProviderInConversationFragment
  }
  isLocked
}
fragment EphemeralUrlFragment on EphemeralUrl {
  __typename
  expiresAt
  url
}
fragment ProviderInConversationFragment on ProviderInConversation {
  __typename
  id
  provider {
    __typename
    ...ProviderFragment
  }
  typingAt
  seenUntil
}
fragment ProviderFragment on Provider {
  __typename
  id
  avatarUrl {
    __typename
    ...EphemeralUrlFragment
  }
  prefix
  firstName
  lastName
}

